			shellPath = /bin/sh;
			shellScript = "###\n#\n# 把API项目打包成 framework并复制到项目目录\n#\n##\n\nOUT_DIR=${PROJECT_DIR}\n\nWORKSPACE_NAME=${PROJECT_NAME}.xcworkspace\n\n##\n# 打包API\n##\nAPI_NAME=\"CTNetworking\"\n\n### 1 生成.framework\n#clean build是先清除原来的build\n# 1.1 生成API.framework For simulator\nxcodebuild -workspace ${WORKSPACE_NAME} -scheme ${API_NAME} -sdk iphonesimulator -configuration \"Release\" clean build\n# 1.2 生成API.framework For device\nxcodebuild -workspace ${WORKSPACE_NAME} -scheme ${API_NAME} -sdk iphoneos -configuration \"Release\" clean build\n\n### 2 将模拟器framework和真机设备framework合并为一个framework\n#因为framework的合并,lipo只是合并了最后的二进制可执行文件,所以其它的需要我们自己复制过来\nAPI_FW_NAME=${API_NAME}.framework\nFW_OUT_DIR=${OUT_DIR}/${API_FW_NAME}\n# 2.1.1 删除旧的framework文件夹，新建一个同名文件夹\nif [ -d \"${FW_OUT_DIR}\" ]; then\nrm -rf \"${FW_OUT_DIR}\"\nfi\nmkdir -p \"${FW_OUT_DIR}\"\n# 2.1.2 把步骤1.2生成设备framework复制到刚新建的同名文件夹下\ncp -R \"${BUILD_DIR}/Release-iphoneos/${API_FW_NAME}\" \"${OUT_DIR}\"\n\n#合并模拟器和真机的架构\nlipo -create  \"${BUILD_DIR}/Release-iphonesimulator/${API_FW_NAME}/${API_NAME}\" \"${BUILD_DIR}/Release-iphoneos/${API_FW_NAME}/${API_NAME}\" -output \"${FW_OUT_DIR}/${API_NAME}\"\n\n# #因为只生成 release，会导致 debug 无法编译，把 release copy到debug\n# if [[ ${CONFIGURATION} == \"Debug\" ]]; then\n# if [ -d \"${BUILD_DIR}/Debug-iphonesimulator\" ]; then\n# rm -rf \"${BUILD_DIR}/Debug-iphonesimulator\"\n# fi\n# cp -R \"${BUILD_DIR}/Release-iphonesimulator\" \"${BUILD_DIR}/Debug-iphonesimulator\"\n\n# if [ -d \"${BUILD_DIR}/Debug-iphoneos\" ]; then\n# rm -rf \"${BUILD_DIR}/Debug-iphoneos\"\n# fi\n# cp -R \"${BUILD_DIR}/Release-iphoneos\" \"${BUILD_DIR}/Debug-iphoneos\"\n# fi\n\n# open \"${BUILD_DIR}/Release-iphonesimulator/${API_FW_NAME}\"\n\nopen \"${OUT_DIR}\"\n\n";
